        super()
        this.state={
            arr:[]
        }
    }
  adddata()
{
    var a=document.getElementById('1'.value)
    var b=document.getElementById('2'.value)
    var c=document.getElementById('3'.value)
    var d=document.getElementById('4'.value)
    var x={
        'id':a,
        'userId':b,
        'title':c,
        'body':d
    }
    element.push(x),
    <a href='/'>add to our list</a>

}
render(){
    return (
        <>
        <form>
        <input type='number' placeholder='enter id' id='1'></input><br></br>
        <input type='text' placeholder='enter user-id' id='2'></input><br></br>
        <input type='text' placeholder='enter title' id='3'></input><br></br>
        <input type='text' placeholder='enter body' id='4'></input><br></br>
        <button onClick={()=>{adddata()}}> submit</button>
        </form>
       </>    
)}
}
export default Form;
